data us_sales au_sales;
	infile "&amp;path\sales3.dat";
	input @1 employeeid 6.
		  @21 lastname $18.
		  @43 jobtitle $20.;
	input @10 country $2. @;
		if country='AU' then
		input @1 salary dollarx8.
			  @24 hiredate ddmmyy10.;
		else if country='US' then 
		input @1 salary dollar8.
		      @24 hiredate mmddyy10.;
	run;
